function Menu() {
    const arrayMenu = [
        "Trang chủ",
        "Giới thiệu",
        "Sản phẩm",
        "Liên hệ",
        "Đăng ký",
        "Tin tức",
        "Thông tin",
        "Hỗ trợ",
        "Cài đặt",
    ];

    const menuListStyle = {
        listStyle: 'none',
        padding: 0,
        margin: 0,
        display: 'flex',
        justifyContent: 'space-around',
        alignItems: 'center',
        backgroundColor: 'lightgray', // Example color
    };

    return (
        <>
            <ul style={menuListStyle}>
                {arrayMenu.map((item, index) => (
                    <li key={index} style={{ padding: '1rem', margin: '0.5rem' }}>
                        {item}
                    </li>
                ))}
            </ul>
        </>
    )
}
export default Menu;
